import React from "react";
import PanelTemplate from "./PanelTemplate";


function EmployeeList() {
    const navigate = useNavigate();
    const git = (page) => {
        navigate(`/manager/${page}`)
    }

    return (
        <PanelTemplate
            title="Employee List"
            rightContent={
                <h2>Employee List Content Here</h2>
            }
        />
    );
}

export default EmployeeList;
